;; gorilla-repl.fileformat = 1

;; **
;;; # Incanter integration
;;; 
;;; Some examples of the integration with the Incanter statistical computing package. To use this in your Gorilla worksheets add a dependency on `incanter-gorilla` to your project, currently at version `0.1.0`.
;;; 
;;; As well as `use`ing the Incanter libraries, also bring in the incanter-gorilla renderer. This allows Incanter charts to be rendered into the worksheet.
;; **

;; @@
(use '(incanter core stats charts datasets))
(use 'incanter-gorilla.render :reload)
(use '[gorilla-repl latex table html])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Let's look at some of the examples from the Incanter getting started document, and the wiki.
;; **

;; @@
(def c (histogram (sample-normal 1000)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/c</span>","value":"#'user/c"}
;; <=

;; **
;;; We can use the function `chart-view` to display the Incanter chart in the worksheet.
;; **

;; @@
(chart-view c)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #<JFreeChart org.jfree.chart.JFreeChart@574d348b>, :opts nil}"}
;; <=

;; **
;;; Another example from "getting started".
;; **

;; @@
(chart-view (function-plot sin -10 10))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #<JFreeChart org.jfree.chart.JFreeChart@74c8b682>, :opts nil}"}
;; <=

;; **
;;; The rendered Incanter charts play nicely with the Gorilla renderer. Let's make a table of charts.
;; **

;; @@
(defn make-row
  [order]
  [order 
   (latex-view (str "x^{" order "} - x"))
   (chart-view
    (function-plot (fn [x] (- (Math/pow x order) x)) 0 1 :y-label "" :x-label "")
    :plot-size 300 :aspect-ratio 2)])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/make-row</span>","value":"#'user/make-row"}
;; <=

;; @@
(table-view (map make-row (range 2 5)) :columns [(html-view "Order") (html-view "Form") (html-view "Plot")])
;; @@
