;; **
;;; Some more involved examples from the wiki:
;; **

;; @@
(def plot (function-plot sin (* -2 Math/PI) (* 2 Math/PI)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/plot</span>","value":"#'user/plot"}
;; <=

;; **
;;; Note that `chart-view` takes a snapshot of the chart's current state. So, if we want to add annotations etc then we need to do that before viewing. Of course, we can view the chart more than once.
;; **

;; @@
(doto plot
  (add-pointer (- Math/PI) (sin (- Math/PI)) 
               :text "(-pi, (sin -pi))")
  (add-pointer Math/PI (sin Math/PI) 
               :text "(pi, (sin pi))" :angle :ne)
  (add-pointer (* 1/2 Math/PI) (sin (* 1/2 Math/PI)) 
               :text "(pi/2, (sin pi/2))" :angle :south))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;JFreeChart org.jfree.chart.JFreeChart@287cfc0a&gt;</span>","value":"#<JFreeChart org.jfree.chart.JFreeChart@287cfc0a>"}
;; <=

;; @@
(doto plot
  (add-pointer 0 0 :text "north" :angle :north)
  (add-pointer 0 0 :text "nw" :angle :nw)
  (add-pointer 0 0 :text "ne" :angle :ne)
  (add-pointer 0 0 :text "west" :angle :west)
  (add-pointer 0 0 :text "east" :angle :east)
  (add-pointer 0 0 :text "south" :angle :south)
  (add-pointer 0 0 :text "sw" :angle :sw)
  (add-pointer 0 0 :text "se" :angle :se))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;JFreeChart org.jfree.chart.JFreeChart@287cfc0a&gt;</span>","value":"#<JFreeChart org.jfree.chart.JFreeChart@287cfc0a>"}
;; <=

;; @@
(chart-view plot)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #<JFreeChart org.jfree.chart.JFreeChart@287cfc0a>, :opts nil}"}
