;; **
;;; And another annotation example:
;; **

;; @@
(def iris (to-matrix (get-dataset :iris)))
 
(def X (sel iris :cols (range 4)))
(def species (sel iris :cols 4))
(def pca (principal-components X))
(def components (:rotation pca))
(def pc1 (sel components :cols 0))
(def pc2 (sel components :cols 1))
(def x1 (mmult X pc1))
(def x2 (mmult X pc2))
 
(def sp (scatter-plot x1 x2
                    :group-by species
                    :x-label "PC1"
                    :y-label "PC2"
                    :title "Iris PCA"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/sp</span>","value":"#'user/sp"}
;; <=

;; @@
(doto sp
  (add-text -2.5 -6.5 "Setosa")
  (add-text -5 -5.5 "Versicolor") 
  (add-text -8 -5.5 "Virginica"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;JFreeChart org.jfree.chart.JFreeChart@790eb2b6&gt;</span>","value":"#<JFreeChart org.jfree.chart.JFreeChart@790eb2b6>"}
;; <=

;; @@
(add-polygon sp 
  [[-3.2 -6.3] [-2 -6.3] [-2 -3.78] [-3.2 -3.78]])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;JFreeChart org.jfree.chart.JFreeChart@790eb2b6&gt;</span>","value":"#<JFreeChart org.jfree.chart.JFreeChart@790eb2b6>"}
;; <=

;; @@
(chart-view sp)
;; @@
